SET SERVEROUTPUT ON;
DECLARE
    G_V_SQL_ID  VARCHAR2(10);
BEGIN

    G_V_SQL_ID := '1';

    G_V_SQL_ID := '2';

    G_V_SQL_ID := '3';

    COMMIT;

EXCEPTION
    WHEN OTHERS THEN
        ROLLBACK;
        DBMS_OUTPUT.PUT_LINE(SQLERRM);
        DBMS_OUTPUT.PUT_LINE(G_V_SQL_ID ||'~ PLEASE UPDATE PK FIELD IN THE SCRIPT');
END;
/
